ed\"}, {\"args\": [\"Hash\"], \"docs\": [\" A tip suggestion has been retracted.\"], \"name\": \"TipRetracted\"}], \"prefix\": \"Treasury\", \"storage\": {\"items\": [{\"docs\": [\" Number of proposals that have been made.\"], \"name\": \"ProposalCount\", \"type\": {\"PlainType\": \"ProposalIndex\"}, \"fallback\": \"0x00000000\", \"modifier\": \"Default\"}, {\"docs\": [\" Proposals that have been made.\"], \"name\": \"Proposals\", \"type\": {\"MapType\": {\"key\": \"ProposalIndex\", \"value\": \"Proposal<AccountId, BalanceOf>\", \"hasher\": \"Blake2_256\", \"isLinked\": false}}, \"fallback\": \"0x00\", \"modifier\": \"Optional\"}, {\"docs\": [\" Proposal indices that have been approved but not yet awarded.\"], \"name\": \"Approvals\", \"type\": {\"PlainType\": \"Vec<ProposalIndex>\"}, \"fallback\": \"0x00\", \"modifier\": \"Default\"}, {\"docs\": [\" Tips that are not yet completed. Keyed by the hash of `(reason, who)` from the value.\", \" This has the insecure enumerable hash function since the key itself is already\", \" guaranteed to be a secure hash.\"], \"name\": \"Tips\", \"type\": {\"MapType\": {\"key\": \"Hash\", \"value\": \"OpenTip<AccountId, BalanceOf, BlockNumber, Hash>\", \"hasher\": \"Twox64Concat\", \"isLinked\": false}}, \"fallback\": \"0x00\", \"modifier\": \"Optional\"}, {\"docs\": [\" Simple preimage lookup from the reason\'s hash to the original data. Again, has an\", \" insecure enumerable hash since the key is guaranteed to be the result of a secure hash.\"], \"name\": \"Reasons\", \"type\": {\"MapType\": {\"key\": \"Hash\", \"value\": \"Bytes\", \"hasher\": \"Twox64Concat\", \"isLinked\": false}}, \"fallback\": \"0x00\", \"modifier\": \"Optional\"}], \"prefix\": \"Treasury\"}, \"constants\": [{\"docs\": [\" Fraction of a proposal\'s value that should be bonded in order to place the proposal.\", \" An accepted proposal gets these back. A rejected proposal does not.\"], \"name\": \"ProposalBond\", \"type\": \"Permill\", \"value\": \"0x50c30000\