INSERT INTO `runtime_call` VALUES (1,1001,'system','fill_block',0,NULL,NULL,'fill_block','0000',' A big dispatch that will disallow any other transaction to be included.',0),(2,1001,'system','remark',1,NULL,NULL,'remark','0001',' Make some on-chain remark.',1),(3,1001,'system','set_heap_pages',2,NULL,NULL,'set_heap_pages','0002',' Set the number of pages in the WebAssembly environment\'s heap.',1),(4,1001,'system','set_code',3,NULL,NULL,'set_code','0003',' Set the new runtime code.',1),(5,1001,'system','set_code_without_checks',4,NULL,NULL,'set_code_without_checks','0004',' Set the new runtime code without doing any checks of the given `code`.',1),(6,1001,'system','set_changes_trie_config',5,NULL,NULL,'set_changes_trie_config','0005',' Set the new changes trie configuration.',1),(7,1001,'system','set_storage',6,NULL,NULL,'set_storage','0006',' Set some items of storage.',1),(8,1001,'system','kill_storage',7,NULL,NULL,'kill_storage','0007',' Kill some items from storage.',1),(9,1001,'system','kill_prefix',8,NULL,NULL,'kill_prefix','0008',' Kill all storage items with a key that starts with the given prefix.',1),(10,1001,'timestamp','set',0,NULL,NULL,'set','0200',' Set the current time.\n\n This call should be invoked exactly once per block. It will panic at the finalization\n phase, if this call hasn\'t been invoked by that time.\n\n The timestamp should be greater than the previous one by the amount specified by\n `MinimumPeriod`.\n\n The dispatch origin for this call must be `Inherent`.',1),(11,1001,'balances','transfer',0,NULL,NULL,'transfer','0400',' Transfer some liquid free balance to another account.\n\n `transfer` will set the `FreeBalance` of the sender and receiver.\n It will decrease the total issuance of the system by the `TransferFee`.\n If the sender\'s account is below the existential deposit as a result\n of the transfer, the account will be reaped.\n\n The dispatch origin for this call must be `Signed` by the transactor.\n\n # <weight>\n - Dependent on arguments but not critical, given proper implementations for\n   input config types. See related functions below.\n - It contains a limited number of reads and writes internally and no complex computation.\n\n Related functions:\n\n   - `ensure_can_withdraw` is always called internally but has a bounded complexity.\n   - Transferring balances to accounts that did not exist before will cause\n      `T::OnNewAccount::on_new_account` to be called.\n   - Removing enough funds from an account will trigger\n     `T::DustRemoval::on_unbalanced` and `T::OnFreeBalanceZero::on_free_balance_zero`.\n   - `transfer_keep_alive` works the same way as `transfer`, but has an additional\n     check that the transfer will not kill the origin account.\n\n # </weight>',2),(12,1001,'balances','set_balance',1,NULL,NULL,'set_balance','0401',' Set the balances of a given account.\n\n This will alter `FreeBalance` and `ReservedBalance` in storage. it will\n also decrease the total issuance of the system (`TotalIssuance`).\n If the new free or reserved balance is below the existential deposit,\n it will reset the account nonce (`frame_system::AccountNonce`).\n\n The dispatch origin for this call is `root`.\n\n # <weight>\n - Independent of the arguments.\n - Contains a limited number of reads and writes.\n # </weight>',3),(13,1001,'balances','force_transfer',2,NULL,NULL,'force_transfer','0402',' Exactly as `transfer`, except the origin must be root and the source account may be\n specified.',3),(14,1001,'balances','transfer_keep_alive',3,NULL,NULL,'transfer_keep_alive','0403',' Same as the [`transfer`] call, but with a check that the transfer will not kill the\n origin account.\n\n 99% of the time you want [`transfer`] instead.\n\n [`transfer`]: struct.Module.html#method.transfer',2),(15,1001,'authorship','set_uncles',0,NULL,NULL,'set_uncles','0500',' Provide a set of uncles.',1),(16,1001,'staking','bond',0,NULL,NULL,'bond','0600',' Take the origin account as a stash and lock up `value` of its balance. `controller` will\n be the account that controls it.\n\n `value` must be more than the `minimum_balance` specified by `T::Currency`.\n\n The dispatch origin for this call must be _Signed_ by the stash account.\n\n # <weight>\n - Independent of the arguments. Moderate complexity.\n - O(1).\n - Three extra DB entries.\n\n NOTE: Two of the storage writes (`Self::bonded`, `Self::payee`) are _never_ cleaned unless\n the `origin` falls below _existential deposit_ and gets removed as dust.\n # </weight>',3),(17,1001,'staking','bond_extra',1,NULL,NULL,'bond_extra','0601',' Add some extra amount that have appeared in the stash `free_balance` into the balance up\n for staking.\n\n Use this if there are additional funds in your stash account that you wish to bond.\n Unlike [`bond`] or [`unbond`] this function does not impose any limitation on the amount\n that can be added.\n\n The dispatch origin for this call must be _Signed_ by the stash, not the controller.\n\n # <weight>\n - Independent of the arguments. Insignificant complexity.\n - O(1).\n - One DB entry.\n # </weight>',1),(18,1001,'staking','unbond',2,NULL,NULL,'unbond','0602',' Schedule a portion of the stash to be unlocked ready for transfer out after the bond\n period ends. If this leaves an amount actively bonded less than\n T::Currency::minimum_balance(), then it is increased to the full amount.\n\n Once the unlock period is done, you can call `withdraw_unbonded` to actually move\n the funds out of management ready for transfer.\n\n No more than a limited number of unlocking chunks (see `MAX_UNLOCKING_CHUNKS`)\n can co-exists at the same time. In that case, [`Call::withdraw_unbonded`] need\n to be called first to remove some of the chunks (if possible).\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n See also [`Call::withdraw_unbonded`].\n\n # <weight>\n - Independent of the arguments. Limited but potentially exploitable complexity.\n - Contains a limited number of reads.\n - Each call (requires the remainder of the bonded balance to be above `minimum_balance`)\n   will cause a new entry to be inserted into a vector (`Ledger.unlocking`) kept in storage.\n   The only way to clean the aforementioned storage item is also user-controlled via `withdraw_unbonded`.\n - One DB entry.\n </weight>',1),(19,1001,'staking','withdraw_unbonded',3,NULL,NULL,'withdraw_unbonded','0603',' Remove any unlocked chunks from the `unlocking` queue from our management.\n\n This essentially frees up that balance to be used by the stash account to do\n whatever it wants.\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n See also [`Call::unbond`].\n\n # <weight>\n - Could be dependent on the `origin` argument and how much `unlocking` chunks exist.\n  It implies `consolidate_unlocked` which loops over `Ledger.unlocking`, which is\n  indirectly user-controlled. See [`unbond`] for more detail.\n - Contains a limited number of reads, yet the size of which could be large based on `ledger`.\n - Writes are limited to the `origin` account key.\n # </weight>',0),(20,1001,'staking','validate',4,NULL,NULL,'validate','0604',' Declare the desire to validate for the origin controller.\n\n Effects will be felt at the beginning of the next era.\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n # <weight>\n - Independent of the arguments. Insignificant complexity.\n - Contains a limited number of reads.\n - Writes are limited to the `origin` account key.\n # </weight>',1),(21,1001,'staking','nominate',5,NULL,NULL,'nominate','0605',' Declare the desire to nominate `targets` for the origin controller.\n\n Effects will be felt at the beginning of the next era.\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n # <weight>\n - The transaction\'s complexity is proportional to the size of `targets`,\n which is capped at `MAX_NOMINATIONS`.\n - Both the reads and writes follow a similar pattern.\n # </weight>',1),(22,1001,'staking','chill',6,NULL,NULL,'chill','0606',' Declare no desire to either validate or nominate.\n\n Effects will be felt at the beginning of the next era.\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n # <weight>\n - Independent of the arguments. Insignificant complexity.\n - Contains one read.\n - Writes are limited to the `origin` account key.\n # </weight>',0),(23,1001,'staking','set_payee',7,NULL,NULL,'set_payee','0607',' (Re-)set the payment target for a controller.\n\n Effects will be felt at the beginning of the next era.\n\n The dispatch origin for this call must be _Signed_ by the controller, not the stash.\n\n # <weight>\n - Independent of the arguments. Insignificant complexity.\n - Contains a limited number of reads.\n - Writes are limited to the `origin` account key.\n # </weight>',1),(24,1001,'staking','set_controller',8,NULL,NULL,'set_controller','0608',' (Re-)set the controller of a stash.\n\n Effects will be felt at the beginning of the next era.\n\n The dispatch origin for this call must be _Signed_ by the stash, not the controller.\n\n # <weight>\n - Independent of the arguments. Insignificant complexity.\n - Contains a limited number of reads.\n - Writes are limited to the `origin` account key.\n # </weight>',1),(25,1001,'staking','set_validator_count',9,NULL,NULL,'set_validator_count','0609',' The ideal number of validators.',1),(26,1001,'staking','force_no_eras',10,NULL,NULL,'force_no_eras','060a',' Force there to be no new eras indefinitely.\n\n # <weight>\n - No arguments.\n # </weight>',0),(27,1001,'staking','force_new_era',11,NULL,NULL,'force_new_era','060b',' Force there to be a new era at the end of the next session. After this, it will be\n reset to normal (non-forced) behaviour.\n\n # <weight>\n - No arguments.\n # </weight>',0),(28,1001,'staking','set_invulnerables',12,NULL,NULL,'set_invulnerables','060c',' Set the validators who cannot be slashed (if any).',1),(29,1001,'staking','force_unstake',13,NULL,NULL,'force_unstake','060d',' Force a current staker to become completely unstaked, immediately.',1),(30,1001,'staking','force_new_era_always',14,NULL,NULL,'force_new_era_always','060e',' Force there to be a new era at the end of sessions indefinitely.\n\n # <weight>\n - One storage write\n # </weight>',0),(31,1001,'staking','cancel_deferred_slash',15,NULL,NULL,'cancel_deferred_slash','060f',' Cancel enactment of a deferred slash. Can be called by either the root origin or\n the `T::SlashCancelOrigin`.\n passing the era and indices of the slashes for that era to kill.\n\n # <weight>\n - One storage write.\n # </weight>',2),(32,1001,'staking','rebond',16,NULL,NULL,'rebond','0610',' Rebond a portion of the stash scheduled to be unlocked.\n\n # <weight>\n - Time complexity: O(1). Bounded by `MAX_UNLOCKING_CHUNKS`.\n - Storage changes: Can\'t increase storage, only decrease it.\n # </weight>',1),(33,1001,'session','set_keys',0,NULL,NULL,'set_keys','0800',' Sets the session key(s) of the function caller to `keys`.\n Allows an account to set its session key prior to becoming a validator.\n This doesn\'t take effect until the next session.\n\n The dispatch origin of this function must be signed.\n\n # <weight>\n - O(log n) in number of accounts.\n - One extra DB entry.\n # </weight>',2),(34,1001,'finalitytracker','final_hint',0,NULL,NULL,'final_hint','0900',' Hint that the author of this block thinks the best finalized\n block is the given number.',1),(35,1001,'grandpa','report_misbehavior',0,NULL,NULL,'report_misbehavior','0a00',' Report some misbehavior.',1),(36,1001,'imonline','heartbeat',0,NULL,NULL,'heartbeat','0b00','',2),(37,1001,'sudo','sudo',0,NULL,NULL,'sudo','0d00',' Authenticates the sudo key and dispatches a function call with `Root` origin.\n\n The dispatch origin for this call must be _Signed_.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB write (event).\n - Unknown weight of derivative `proposal` execution.\n # </weight>',1),(38,1001,'sudo','set_key',1,NULL,NULL,'set_key','0d01',' Authenticates the current sudo key and sets the given AccountId (`new`) as the new sudo key.\n\n The dispatch origin for this call must be _Signed_.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB change.\n # </weight>',1),(39,1001,'sudo','sudo_as',2,NULL,NULL,'sudo_as','0d02',' Authenticates the sudo key and dispatches a function call with `Signed` origin from\n a given account.\n\n The dispatch origin for this call must be _Signed_.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB write (event).\n - Unknown weight of derivative `proposal` execution.\n # </weight>',2),(40,1001,'democracy','propose',0,NULL,NULL,'propose','0e00',' Propose a sensitive action to be taken.\n\n # <weight>\n - O(1).\n - Two DB changes, one DB entry.\n # </weight>',2),(41,1001,'democracy','second',1,NULL,NULL,'second','0e01',' Propose a sensitive action to be taken.\n\n # <weight>\n - O(1).\n - One DB entry.\n # </weight>',1),(42,1001,'democracy','vote',2,NULL,NULL,'vote','0e02',' Vote in a referendum. If `vote.is_aye()`, the vote is to enact the proposal;\n otherwise it is a vote to keep the status quo.\n\n # <weight>\n - O(1).\n - One DB change, one DB entry.\n # </weight>',2),(43,1001,'democracy','proxy_vote',3,NULL,NULL,'proxy_vote','0e03',' Vote in a referendum on behalf of a stash. If `vote.is_aye()`, the vote is to enact\n the proposal; otherwise it is a vote to keep the status quo.\n\n # <weight>\n - O(1).\n - One DB change, one DB entry.\n # </weight>',2),(44,1001,'democracy','emergency_cancel',4,NULL,NULL,'emergency_cancel','0e04',' Schedule an emergency cancellation of a referendum. Cannot happen twice to the same\n referendum.',1),(45,1001,'democracy','external_propose',5,NULL,NULL,'external_propose','0e05',' Schedule a referendum to be tabled once it is legal to schedule an external\n referendum.',1),(46,1001,'democracy','external_propose_majority',6,NULL,NULL,'external_propose_majority','0e06',' Schedule a majority-carries referendum to be tabled next once it is legal to schedule\n an external referendum.\n\n Unlike `external_propose`, blacklisting has no effect on this and it may replace a\n pre-scheduled `external_propose` call.',1),(47,1001,'democracy','external_propose_default',7,NULL,NULL,'external_propose_default','0e07',' Schedule a negative-turnout-bias referendum to be tabled next once it is legal to\n schedule an external referendum.\n\n Unlike `external_propose`, blacklisting has no effect on this and it may replace a\n pre-scheduled `external_propose` call.',1),(48,1001,'democracy','fast_track',8,NULL,NULL,'fast_track','0e08',' Schedule the currently externally-proposed majority-carries referendum to be tabled\n immediately. If there is no externally-proposed referendum currently, or if there is one\n but it is not a majority-carries referendum then it fails.\n\n - `proposal_hash`: The hash of the current external proposal.\n - `voting_period`: The period that is allowed for voting on this proposal. Increased to\n   `EmergencyVotingPeriod` if too low.\n - `delay`: The number of block after voting has ended in approval and this should be\n   enacted. This doesn\'t have a minimum amount.',3),(49,1001,'democracy','veto_external',9,NULL,NULL,'veto_external','0e09',' Veto and blacklist the external proposal hash.',1),(50,1001,'democracy','cancel_referendum',10,NULL,NULL,'cancel_referendum','0e0a',' Remove a referendum.',1),(51,1001,'democracy','cancel_queued',11,NULL,NULL,'cancel_queued','0e0b',' Cancel a proposal queued for enactment.',1),(52,1001,'democracy','set_proxy',12,NULL,NULL,'set_proxy','0e0c',' Specify a proxy. Called by the stash.\n\n # <weight>\n - One extra DB entry.\n # </weight>',1),(53,1001,'democracy','resign_proxy',13,NULL,NULL,'resign_proxy','0e0d',' Clear the proxy. Called by the proxy.\n\n # <weight>\n - One DB clear.\n # </weight>',0),(54,1001,'democracy','remove_proxy',14,NULL,NULL,'remove_proxy','0e0e',' Clear the proxy. Called by the stash.\n\n # <weight>\n - One DB clear.\n # </weight>',1),(55,1001,'democracy','delegate',15,NULL,NULL,'delegate','0e0f',' Delegate vote.\n\n # <weight>\n - One extra DB entry.\n # </weight>',2),(56,1001,'democracy','undelegate',16,NULL,NULL,'undelegate','0e10',' Undelegate vote.\n\n # <weight>\n - O(1).\n # </weight>',0),(57,1001,'democracy','clear_public_proposals',17,NULL,NULL,'clear_public_proposals','0e11',' Veto and blacklist the proposal hash. Must be from Root origin.',0),(58,1001,'democracy','note_preimage',18,NULL,NULL,'note_preimage','0e12',' Register the preimage for an upcoming proposal. This doesn\'t require the proposal to be\n in the dispatch queue but does require a deposit, returned once enacted.',1),(59,1001,'democracy','note_imminent_preimage',19,NULL,NULL,'note_imminent_preimage','0e13',' Register the preimage for an upcoming proposal. This requires the proposal to be\n in the dispatch queue. No deposit is needed.',1),(60,1001,'democracy','reap_preimage',20,NULL,NULL,'reap_preimage','0e14',' Remove an expired proposal preimage and collect the deposit.\n\n This will only work after `VotingPeriod` blocks from the time that the preimage was\n noted, if it\'s the same account doing it. If it\'s a different account, then it\'ll only\n work an additional `EnactmentPeriod` later.',1),(61,1001,'council','set_members',0,NULL,NULL,'set_members','0f00',' Set the collective\'s membership manually to `new_members`. Be nice to the chain and\n provide it pre-sorted.\n\n Requires root origin.',1),(62,1001,'council','execute',1,NULL,NULL,'execute','0f01',' Dispatch a proposal from a member using the `Member` origin.\n\n Origin must be a member of the collective.',1),(63,1001,'council','propose',2,NULL,NULL,'propose','0f02',' # <weight>\n - Bounded storage reads and writes.\n - Argument `threshold` has bearing on weight.\n # </weight>',2),(64,1001,'council','vote',3,NULL,NULL,'vote','0f03',' # <weight>\n - Bounded storage read and writes.\n - Will be slightly heavier if the proposal is approved / disapproved after the vote.\n # </weight>',3),(65,1001,'technicalcommittee','set_members',0,NULL,NULL,'set_members','1000',' Set the collective\'s membership manually to `new_members`. Be nice to the chain and\n provide it pre-sorted.\n\n Requires root origin.',1),(66,1001,'technicalcommittee','execute',1,NULL,NULL,'execute','1001',' Dispatch a proposal from a member using the `Member` origin.\n\n Origin must be a member of the collective.',1),(67,1001,'technicalcommittee','propose',2,NULL,NULL,'propose','1002',' # <weight>\n - Bounded storage reads and writes.\n - Argument `threshold` has bearing on weight.\n # </weight>',2),(68,1001,'technicalcommittee','vote',3,NULL,NULL,'vote','1003',' # <weight>\n - Bounded storage read and writes.\n - Will be slightly heavier if the proposal is approved / disapproved after the vote.\n # </weight>',3),(69,1001,'electionsphragmen','vote',0,NULL,NULL,'vote','1100',' Vote for a set of candidates for the upcoming round of election.\n\n The `votes` should:\n   - not be empty.\n   - be less than the number of candidates.\n\n Upon voting, `value` units of `who`\'s balance is locked and a bond amount is reserved.\n It is the responsibility of the caller to not place all of their balance into the lock\n and keep some for further transactions.\n\n # <weight>\n #### State\n Reads: O(1)\n Writes: O(V) given `V` votes. V is bounded by 16.\n # </weight>',2),(70,1001,'electionsphragmen','remove_voter',1,NULL,NULL,'remove_voter','1101',' Remove `origin` as a voter. This removes the lock and returns the bond.\n\n # <weight>\n #### State\n Reads: O(1)\n Writes: O(1)\n # </weight>',0),(71,1001,'electionsphragmen','report_defunct_voter',2,NULL,NULL,'report_defunct_voter','1102',' Report `target` for being an defunct voter. In case of a valid report, the reporter is\n rewarded by the bond amount of `target`. Otherwise, the reporter itself is removed and\n their bond is slashed.\n\n A defunct voter is defined to be:\n   - a voter whose current submitted votes are all invalid. i.e. all of them are no\n     longer a candidate nor an active member.\n\n # <weight>\n #### State\n Reads: O(NLogM) given M current candidates and N votes for `target`.\n Writes: O(1)\n # </weight>',1),(72,1001,'electionsphragmen','submit_candidacy',3,NULL,NULL,'submit_candidacy','1103',' Submit oneself for candidacy.\n\n A candidate will either:\n   - Lose at the end of the term and forfeit their deposit.\n   - Win and become a member. Members will eventually get their stash back.\n   - Become a runner-up. Runners-ups are reserved members in case one gets forcefully\n     removed.\n\n # <weight>\n #### State\n Reads: O(LogN) Given N candidates.\n Writes: O(1)\n # </weight>',0),(73,1001,'electionsphragmen','renounce_candidacy',4,NULL,NULL,'renounce_candidacy','1104',' Renounce one\'s intention to be a candidate for the next election round. 3 potential\n outcomes exist:\n - `origin` is a candidate and not elected in any set. In this case, the bond is\n   unreserved, returned and origin is removed as a candidate.\n - `origin` is a current runner up. In this case, the bond is unreserved, returned and\n   origin is removed as a runner.\n - `origin` is a current member. In this case, the bond is unreserved and origin is\n   removed as a member, consequently not being a candidate for the next round anymore.\n   Similar to [`remove_voter`], if replacement runners exists, they are immediately used.',0),(74,1001,'electionsphragmen','remove_member',5,NULL,NULL,'remove_member','1105',' Remove a particular member from the set. This is effective immediately and the bond of\n the outgoing member is slashed.\n\n If a runner-up is available, then the best runner-up will be removed and replaces the\n outgoing member. Otherwise, a new phragmen round is started.\n\n Note that this does not affect the designated block number of the next election.\n\n # <weight>\n #### State\n Reads: O(do_phragmen)\n Writes: O(do_phragmen)\n # </weight>',1),(75,1001,'technicalmembership','add_member',0,NULL,NULL,'add_member','1200',' Add a member `who` to the set.\n\n May only be called from `AddOrigin` or root.',1),(76,1001,'technicalmembership','remove_member',1,NULL,NULL,'remove_member','1201',' Remove a member `who` from the set.\n\n May only be called from `RemoveOrigin` or root.',1),(77,1001,'technicalmembership','swap_member',2,NULL,NULL,'swap_member','1202',' Swap out one member `remove` for another `add`.\n\n May only be called from `SwapOrigin` or root.',2),(78,1001,'technicalmembership','reset_members',3,NULL,NULL,'reset_members','1203',' Change the membership to a new set, disregarding the existing membership. Be nice and\n pass `members` pre-sorted.\n\n May only be called from `ResetOrigin` or root.',1),(79,1001,'technicalmembership','change_key',4,NULL,NULL,'change_key','1204',' Swap out the sending member for some other key `new`.\n\n May only be called from `Signed` origin of a current member.',1),(80,1001,'treasury','propose_spend',0,NULL,NULL,'propose_spend','1300',' Put forward a suggestion for spending. A deposit proportional to the value\n is reserved and slashed if the proposal is rejected. It is returned once the\n proposal is awarded.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB change, one extra DB entry.\n # </weight>',2),(81,1001,'treasury','reject_proposal',1,NULL,NULL,'reject_proposal','1301',' Reject a proposed spend. The original deposit will be slashed.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB clear.\n # </weight>',1),(82,1001,'treasury','approve_proposal',2,NULL,NULL,'approve_proposal','1302',' Approve a proposal. At a later time, the proposal will be allocated to the beneficiary\n and the original deposit will be returned.\n\n # <weight>\n - O(1).\n - Limited storage reads.\n - One DB change.\n # </weight>',1),(83,1001,'treasury','report_awesome',3,NULL,NULL,'report_awesome','1303',' Report something `reason` that deserves a tip and claim any eventual the finder\'s fee.\n\n The dispatch origin for this call must be _Signed_.\n\n Payment: `TipReportDepositBase` will be reserved from the origin account, as well as\n `TipReportDepositPerByte` for each byte in `reason`.\n\n - `reason`: The reason for, or the thing that deserves, the tip; generally this will be\n   a UTF-8-encoded URL.\n - `who`: The account which should be credited for the tip.\n\n Emits `NewTip` if successful.\n\n # <weight>\n - `O(R)` where `R` length of `reason`.\n - One balance operation.\n - One storage mutation (codec `O(R)`).\n - One event.\n # </weight>',2),(84,1001,'treasury','retract_tip',4,NULL,NULL,'retract_tip','1304',' Retract a prior tip-report from `report_awesome`, and cancel the process of tipping.\n\n If successful, the original deposit will be unreserved.\n\n The dispatch origin for this call must be _Signed_ and the tip identified by `hash`\n must have been reported by the signing account through `report_awesome` (and not\n through `tip_new`).\n\n - `hash`: The identity of the open tip for which a tip value is declared. This is formed\n   as the hash of the tuple of the original tip `reason` and the beneficiary account ID.\n\n Emits `TipRetracted` if successful.\n\n # <weight>\n - `O(T)`\n - One balance operation.\n - Two storage removals (one read, codec `O(T)`).\n - One event.\n # </weight>',1),(85,1001,'treasury','tip_new',5,NULL,NULL,'tip_new','1305',' Give a tip for something new; no finder\'s fee will be taken.\n\n The dispatch origin for this call must be _Signed_ and the signing account must be a\n member of the `Tippers` set.\n\n - `reason`: The reason for, or the thing that deserves, the tip; generally this will be\n   a UTF-8-encoded URL.\n - `who`: The account which should be credited for the tip.\n - `tip_value`: The amount of tip that the sender would like to give. The median tip\n   value of active tippers will be given to the `who`.\n\n Emits `NewTip` if successful.\n\n # <weight>\n - `O(R + T)` where `R` length of `reason`, `T` is the number of tippers. `T` is\n   naturally capped as a membership set, `R` is limited through transaction-size.\n - Two storage insertions (codecs `O(R)`, `O(T)`), one read `O(1)`.\n - One event.\n # </weight>',3),(86,1001,'treasury','tip',6,NULL,NULL,'tip','1306',' Declare a tip value for an already-open tip.\n\n The dispatch origin for this call must be _Signed_ and the signing account must be a\n member of the `Tippers` set.\n\n - `hash`: The identity of the open tip for which a tip value is declared. This is formed\n   as the hash of the tuple of the hash of the original tip `reason` and the beneficiary\n   account ID.\n - `tip_value`: The amount of tip that the sender would like to give. The median tip\n   value of active tippers will be given to the `who`.\n\n Emits `TipClosing` if the threshold of tippers has been reached and the countdown period\n has started.\n\n # <weight>\n - `O(T)`\n - One storage mutation (codec `O(T)`), one storage read `O(1)`.\n - Up to one event.\n # </weight>',2),(87,1001,'treasury','close_tip',7,NULL,NULL,'close_tip','1307',' Close and payout a tip.\n\n The dispatch origin for this call must be _Signed_.\n\n The tip identified by `hash` must have finished its countdown period.\n\n - `hash`: The identity of the open tip for which a tip value is declared. This is formed\n   as the hash of the tuple of the original tip `reason` and the beneficiary account ID.\n\n # <weight>\n - `O(T)`\n - One storage retrieval (codec `O(T)`) and two removals.\n - Up to three balance operations.\n # </weight>',1),(88,1001,'claims','claim',0,NULL,NULL,'claim','1400',' Make a claim.',2),(89,1001,'claims','mint_claim',1,NULL,NULL,'mint_claim','1401',' Add a new claim, if you are root.',3),(90,1001,'parachains','set_heads',0,NULL,NULL,'set_heads','1500',' Provide candidate receipts for parachains, in ascending order by id.',1),(91,1001,'attestations','more_attestations',0,NULL,NULL,'more_attestations','1600',' Provide candidate receipts for parachains, in ascending order by id.',1),(92,1001,'slots','new_auction',0,NULL,NULL,'new_auction','1700',' Create a new auction.\n\n This can only happen when there isn\'t already an auction in progress and may only be\n called by the root origin. Accepts the `duration` of this auction and the\n `lease_period_index` of the initial lease period of the four that are to be auctioned.',2),(93,1001,'slots','bid',1,NULL,NULL,'bid','1701',' Make a new bid from an account (including a parachain account) for deploying a new\n parachain.\n\n Multiple simultaneous bids from the same bidder are allowed only as long as all active\n bids overlap each other (i.e. are mutually exclusive). Bids cannot be redacted.\n\n - `sub` is the sub-bidder ID, allowing for multiple competing bids to be made by (and\n funded by) the same account.\n - `auction_index` is the index of the auction to bid on. Should just be the present\n value of `AuctionCounter`.\n - `first_slot` is the first lease period index of the range to bid on. This is the\n absolute lease period index value, not an auction-specific offset.\n - `last_slot` is the last lease period index of the range to bid on. This is the\n absolute lease period index value, not an auction-specific offset.\n - `amount` is the amount to bid to be held as deposit for the parachain should the\n bid win. This amount is held throughout the range.',5),(94,1001,'slots','bid_renew',2,NULL,NULL,'bid_renew','1702',' Make a new bid from a parachain account for renewing that (pre-existing) parachain.\n\n The origin *must* be a parachain account.\n\n Multiple simultaneous bids from the same bidder are allowed only as long as all active\n bids overlap each other (i.e. are mutually exclusive). Bids cannot be redacted.\n\n - `auction_index` is the index of the auction to bid on. Should just be the present\n value of `AuctionCounter`.\n - `first_slot` is the first lease period index of the range to bid on. This is the\n absolute lease period index value, not an auction-specific offset.\n - `last_slot` is the last lease period index of the range to bid on. This is the\n absolute lease period index value, not an auction-specific offset.\n - `amount` is the amount to bid to be held as deposit for the parachain should the\n bid win. This amount is held throughout the range.',4),(95,1001,'slots','set_offboarding',3,NULL,NULL,'set_offboarding','1703',' Set the off-boarding information for a parachain.\n\n The origin *must* be a parachain account.\n\n - `dest` is the destination account to receive the parachain\'s deposit.',1),(96,1001,'slots','fix_deploy_data',4,NULL,NULL,'fix_deploy_data','1704',' Set the deploy information for a successful bid to deploy a new parachain.\n\n - `origin` must be the successful bidder account.\n - `sub` is the sub-bidder ID of the bidder.\n - `para_id` is the parachain ID allotted to the winning bidder.\n - `code_hash` is the hash of the parachain\'s Wasm validation function.\n - `initial_head_data` is the parachain\'s initial head data.',4),(97,1001,'slots','elaborate_deploy_data',5,NULL,NULL,'elaborate_deploy_data','1705',' Note a new parachain\'s code.\n\n This must be called after `fix_deploy_data` and `code` must be the preimage of the\n `code_hash` passed there for the same `para_id`.\n\n This may be called before or after the beginning of the parachain\'s first lease period.\n If called before then the parachain will become active at the first block of its\n starting lease period. If after, then it will become active immediately after this call.\n\n - `_origin` is irrelevant.\n - `para_id` is the parachain ID whose code will be elaborated.\n - `code` is the preimage of the registered `code_hash` of `para_id`.',2),(98,1001,'registrar','register_para',0,NULL,NULL,'register_para','1800',' Register a parachain with given code.\n Fails if given ID is already used.',4),(99,1001,'registrar','deregister_para',1,NULL,NULL,'deregister_para','1801',' Deregister a parachain with given id',1),(100,1001,'registrar','set_thread_count',2,NULL,NULL,'set_thread_count','1802',' Reset the number of parathreads that can pay to be scheduled in a single block.\n\n - `count`: The number of parathreads.\n\n Must be called from Root origin.',1),(101,1001,'registrar','register_parathread',3,NULL,NULL,'register_parathread','1803',' Register a parathread for immediate use.\n\n Must be sent from a Signed origin that is able to have ParathreadDeposit reserved.\n `code` and `initial_head_data` are used to initialize the parathread\'s state.',2),(102,1001,'registrar','select_parathread',4,NULL,NULL,'select_parathread','1804',' Place a bid for a parathread to be progressed in the next block.\n\n This is a kind of special transaction that should be heavily prioritized in the\n transaction pool according to the `value`; only `ThreadCount` of them may be presented\n in any single block.',3),(103,1001,'registrar','deregister_parathread',5,NULL,NULL,'deregister_parathread','1805',' Deregister a parathread and retrieve the deposit.\n\n Must be sent from a `Parachain` origin which is currently a parathread.\n\n Ensure that before calling this that any funds you want emptied from the parathread\'s\n account is moved out; after this it will be impossible to retrieve them (without\n governance intervention).',0),(104,1001,'registrar','swap',6,NULL,NULL,'swap','1806',' Swap a parachain with another parachain or parathread. The origin must be a `Parachain`.\n The swap will happen only if there is already an opposite swap pending. If there is not,\n the swap will be stored in the pending swaps map, ready for a later confirmatory swap.\n\n The `ParaId`s remain mapped to the same head data and code so external code can rely on\n `ParaId` to be a long-term identifier of a notional \"parachain\". However, their\n scheduling info (i.e. whether they\'re a parathread or parachain), auction information\n and the auction deposit are switched.',1);
